function initMap() {
    map = new AMap.Map('mapContainer', {
        center: [121.238825, 31.364284],
        zoom: 12,
        zooms: [11, 18],  //设置地图缩放级别
    });

    setMapStyle();      /*设置地图风格*/
    setMapFeatures();   /*设置地图显示要素*/
    drawJiadingBounds();   //加载行政区划插件
    addJiadingBoundary();  /*添加嘉定区和街道边界*/
    addJiadingZhenText();
    addTraffic();           /*添加实时路况情况*/
    addPoiMarker();         /*添加嘉定区主要监控点*/
    //  map.addControl(new AMap.Scale());
}

/*设置地图风格*/
function setMapStyle() {

    var myStyle = "amap://styles/5078b8edf11b4b3f9ab4b0e45c45e8fe";
    map.setMapStyle(myStyle);
}

/*设置地图显示要素*/
var mapFeatures = ["bg",       //背景
    "road",     //道路，包含路名
    "building", //建筑物
    "point"     //兴趣点
];

function setMapFeatures() {
    var features = [mapFeatures[0], mapFeatures[1], mapFeatures[2]];
    map.setFeatures(features);
}
function init1 () {//区域遮盖
    let  city='嘉定区'
    var that =this
    if( that.polygon ) {
        that.map.remove(that.polygon)
    }
    AMap.plugin('AMap.DistrictSearch', function () {
        new AMap.DistrictSearch({
            extensions: 'all',
            subdistrict: 0
        }).search(city, function(status, result) {// 外多边形坐标数组和内多边形坐标数组
            var outer = [
                new AMap.LngLat(-360, 90, true),
                new AMap.LngLat(-360, -90, true),
                new AMap.LngLat(360, -90, true),
                new AMap.LngLat(360, 90, true)
            ]
            var holes = result.districtList[0].boundaries
            var pathArray = [outer]
            pathArray.push.apply(pathArray, holes)
            that.polygon = new AMap.Polygon({
                pathL: pathArray,
                // strokeColor: 'red',//城市边界颜色
                // strokeWeight: 1,
                // fillColor: '#220986', // 遮罩背景色黑色
                // fillOpacity: 0.1
                strokeColor: '#9CA09D',
                fillOpacity: 1,
                fillColor: '#061839',
            })
            that.polygon.setPath(pathArray)
            that.map.add(that.polygon)
        })
    })
}
function drawJiadingBounds() {
    AMap.plugin('AMap.DistrictSearch', function () {
        // 创建行政区查询对象
        var district = new AMap.DistrictSearch({
            extensions: 'all', // 返回行政区边界坐标等具体信息
            level: 'district' // 设置查询行政区级别为 区
        })

        district.search('嘉定区', function(status, result) {
            // 获取朝阳区的边界信息
            var bounds = result.districtList[0].boundaries
            var polygons = []
            if (bounds) {
                for (var i = 0, l = bounds.length; i < l; i++) {
                    //生成行政区划polygon
                    var polygon = new AMap.Polygon({
                        map: map,
                        strokeWeight: 1,
                        path: bounds[i],
                        fillOpacity: 0.7,
                        fillColor: 'transparent',
                        strokeColor: 'rgba(0, 0, 0, .3)'
                    })
                    polygons.push(polygon)
                }
                // 地图自适应
                // map.setFitView()
                // map.getZoom
                // console.log("getZoom",map.getZoom())
                // console.log("getZoom",map.setZoom(10))

            }
        })
    })
}

